import "./projects-path.css";

import Container from "@mui/material/Container";
import { Link } from "react-router-dom";
import Nav from "../../../Nav";
import img1 from "../../../../img/2 copy.png";
import img2 from "../../../../img/6.png";
import img3 from "../../../../img/3 copy.png";
import img4 from "../../../../img/5.png";
import img5 from "../../../../img/4 copy.png";
import img6 from "../../../../img/7.png";
export default function ProjectsPath() {
  return (
    <>
      <Nav />
      <div className="paths">
        <Link to={"web"} style={{ textDecoration: "none" }}>
          <div className="paths-div">
            <img
              src={img1}
              alt=""
              width="50%"
              style={{ marginLeft: "60px", marginTop: "70px" }}
            ></img>
          </div>
        </Link>

        <Link to={"android"} style={{ textDecoration: "none" }}>
          <div className="paths-div">
            {" "}
            <img
              src={img2}
              alt=""
              width="90%"
              style={{ marginLeft: "10px", marginTop: "70px" }}
            ></img>
          </div>
        </Link>

        <Link to={"ios"} style={{ textDecoration: "none" }}>
          <div className="paths-div">
            {" "}
            <img
              src={img3}
              alt=""
              width="40%"
              style={{ marginLeft: "80px", marginTop: "70px" }}
            ></img>
          </div>
        </Link>

        <Link to={"ux"} style={{ textDecoration: "none" }}>
          <div className="paths-div">
            <img
              src={img4}
              alt=""
              width="30%"
              style={{  marginLeft: "90px", marginTop: "70px" }}
            ></img>
          </div>
        </Link>

        <Link to={"ui"} style={{ textDecoration: "none" }}>
          <div className="paths-div">
            {" "}
            <img
              src={img5}
              alt=""
              width="25%"
              style={{ marginLeft: "100px", marginTop: "70px" }}
            ></img>
          </div>
        </Link>

        <Link to={"security"} style={{ textDecoration: "none" }}>
          <div className="paths-div">
            {" "}
            <img
              src={img6}
              alt=""
              width="90%"
              style={{ marginLeft: "20px", marginTop: "70px" }}
            ></img>
          </div>
        </Link>
      </div>
    </>
  );
}
